      temp: {
        type: Number,
        default: 0,
      },
      fuel: {
        type: Number,
        default: 0,
      },
      ph1: {
        type: Number,
        default: 0,
      },
      ph2: {
        type: Number,
        default: 0,
      },
      ph3: {
        type: Number,
        default: 0,
      },
      oilPress: {
        type: Number,
        default: 0,
      },
      freq: {
        type: Number,
        default: 0,
      },
    },
    temp: {
      type: String,
      default:"000°C"
    },
    fuel: {
      type: String,
      default:"000%"
    },
    bat: {
      type: String,
      default:"00.0VDC"
    },
    ph1: {
      type: String,
      default:"000VAC"
    },
    ph2: {
      type: String,
      default:"000VAC"
    },
    ph3: {
      type: String,
      default:"000VAC"
    },
    freq: {
      type: String,
      default:"000Hz"
    },
    oilPress: {
      type: String,
      default:"000BAR"
    },
    elapse_total: {
      milliseconds: {
        type: Number,
        default: 0,
      },
      seconds: {
        type: Number,
        default: 0,
      },
      minutes: {
        type: Number,
        default: 0,
      },
      hours: {
        type: Number,
        default: 0,
      },
      days: {
        type: Number,
        default: 0,
      },
      months: {
        type: Number,
        default: 0,
      },
      years: {
        type: Number,
        default: 0,
      },
    },
    stationName: {
      type: String,
      trim: true,
      required: true,
      unique: true,
    },
    position: {
      lat: {
        type: Number,
      },
      long: {
        type: Number,
      },
    },
    elapse_total_number: {
      type: Number,
      default: 0,
    },
    duree_temporaire: {
      type: Number,
    },
    elapse: {
      milliseconds: {
        type: Number,
        default: 0,
      },
      seconds: {
