        default: 0,
      },
      minutes: {
        type: Number,
        default: 0,
      },
      hours: {
        type: Number,
        default: 0,
      },
      days: {
        type: Number,
        default: 0,
      },
      months: {
        type: Number,
        default: 0,
      },
      years: {
        type: Number,
        default: 0,
      },
    },
    status: {
      type: String,
      enum: [
        "NOT_RUNNING",
        "NOT_RUNNING/FAULT",
        "STOPPED",
        "RUNNING",
        "RUNNING/FAULT",
      ],
    },
  },
  { timestamps: true }
);
